css:
.nuclide-ui-table {
  border: 1px solid #9f9f9f;
  table-layout: fixed;
  width: 100%;
  -webkit-user-select: none;
}
.nuclide-ui-table-body {
  border-top: none;
}
.nuclide-ui-table-header {
  font-weight: bold;
  background-color: #f4f4f4;
  border-bottom: 1px solid #9f9f9f;
}
.nuclide-ui-table-header-cell,
.nuclide-ui-table-body-cell {
  border-right: 1px solid #9f9f9f;
  overflow: hidden;
  padding: 2px 4px;
}
.nuclide-ui-table-body-cell {
  word-break: break-word;
  text-overflow: inherit;
}
.nuclide-ui-table-header-cell {
  -webkit-user-select: none;
  position: relative;
  text-overflow: ellipsis;
  vertical-align: baseline;
  white-space: nowrap;
}
.nuclide-ui-table-header-cell-sortable {
  cursor: pointer;
}
.nuclide-ui-table-header-cell-sortable:hover {
  color: #000000;
}
.nuclide-ui-table-header-resize-handle {
  cursor: ew-resize;
  position: absolute;
  right: 0;
  top: 0;
  bottom: 0;
  width: 5px;
  margin-right: -3px;
  z-index: 1;
}
.nuclide-ui-table-row-alternate {
  background-color: rgba(0, 0, 0, 0.1);
}
.nuclide-ui-table-row-selectable {
  cursor: pointer;
}
.nuclide-ui-table-row-selectable:hover {
  background-color: #6aa5e9;
  color: #ffffff;
}
.nuclide-ui-table-row-selected {
  background-color: #6aa5e9;
  color: #ffffff;
  font-weight: bold;
}
.nuclide-ui-table-collapsed-row {
  word-break: break-word;
  text-overflow: ellipsis;
  white-space: nowrap;
}
.nuclide-ui-table-empty-message {
  font-style: italic;
  padding: 1em;
  text-align: center;
}
